import React from "react";
import { Router,  Routes ,Route  } from "react-router-dom";
import App from "./App.js";
import Car from "./Car.js";
function Main(){
    return(
        <Router>
            <Routes>
                <Route exact path="/" component={App} />
                <Route exact path="/Car" component={Car} /> 
        </Routes>
       </Router>
    )
}
export default Main;
